func lengthOfLongestSubstring(s string) int {
	//无法通过校验的版本
	//arr := make(map[string]int)
	//maxLen := 0
	//sLen := len(s)
	////单字符有序数组
	//for i := range s {
	//	for l, d := range s {
	//		if l < i {
	//			continue
	//		}
	//		if _, ok := arr[string(d)]; ok {
	//			if len(arr) > maxLen {
	//				maxLen = len(arr)
	//			}
	//			arr = make(map[string]int)
	//			arr[string(d)] = 1
	//			if (sLen - l) < maxLen {
	//				break
	//			}
	//		} else {
	//			arr[string(d)] = 1
	//		}
	//		if len(arr) > maxLen {
	//			maxLen = len(arr)
	//		}
	//	}
	//	arr = make(map[string]int)
	//}
	//滑动窗口  
	sMap := make(map[string]int)
	var i, l, maxLen = 0, 0, 0
	sLen := len(s)
	for i < sLen && l < sLen {
		if _, ok := sMap[string(s[l])]; !ok {
			sMap[string(s[l])] = 1
			l++
			if maxLen<l-i {
				maxLen = l-i
			}
		} else {
			delete(sMap,string(s[i]))
			i++
		}
	}
	return maxLen
}

